import React from 'react'
import './App.css';
import amazon from './assets/amazon.png'
import { Button, Container, Typography, Toolbar, AppBar } from '@material-ui/core';
function App() {
  return (
    // <Container maxWidth="lg">
    <React.Fragment>
      {}
    <AppBar>
    <Toolbar>
    <Typography>
    Get Started
    </Typography>
    </Toolbar>
    </AppBar>
    <img src ={amazon} className="img" alt="No Preview"/>
    </React.Fragment>
    // </Container>
  );
}

export default App;
